import React from 'react';
import Navbar from './components/Navbar';
import './App.css';
import Home from './components/pages/Home';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Services from './components/pages/Services';
import SignUp from './components/pages/SignUp';
import Login from './components/pages/Login';
import Medical from './components/pages/Medical';
import Map from './components/pages/MapWithLocation';


function App() {
  return (
    // <>
    //   <Router>
    //     <Navbar />
    //     <Switch>
    //       <Route path='/' exact component={Home} />
    //       <Route path='/services' component={Services} />
    //       <Route path='/medical' component={Mal} />

    //       <Route path='/sign-up' component={SignUp} />
    //       <Route path='/login' component={Login} />
    //       <Route path='/map' component={Map} />

    //     </Switch>
    //   </Router>
    // </>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/services" element={<Services />} />
        <Route path="/medical" element={<Medical />} />
        <Route path="/sign-u" element={<Login />} />
        <Route path="/logout" element={<Logout />} />
        <Route path="/usrgenerate" element={<USRgenerate />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/signup" element={<SignUp />} />
        <Route path="/sentences/" element={<Sentences />} />
        <Route path="/usr/" element={<USR />} />
        <Route path="/forgotpassword/" element={<ForgotPassword />} />
    </Routes>
  );
}

export default App;
